import { Col } from 'react-bootstrap';
import { useDispatch } from 'react-redux';

const RecipesList = () => {
  return (
    <>
      <Row>
        <Col xs={6} md={4}>
          <h1>Recipes List</h1>
        </Col>
      </Row>
    </>
  )
}

export default RecipesList;
